import DB  from "../Data/DataBase.json"
import { BrowserRouter, Link } from 'react-router-dom';

function TopMenu() 
{
    /*
               <Link to = {`${DB.PageList[0][0]}`}>
                <button>{`${DB.PageList[0][1]}`}</button>
            </Link>
            
            <Link to = {`${DB.PageList[1][0]}`}>
                <button>{`${DB.PageList[1][1]}`}</button>
            </Link>
            */
    return(
        <BrowserRouter>
            
            <Link to = {`${DB.PageList[0][0]}`}>
                <button>{`${DB.PageList[0][1]}`}</button>
            </Link>
            
            <Link to = {`${DB.PageList[1][0]}`}>
                <button>{`${DB.PageList[1][1]}`}</button>
            </Link>

        </BrowserRouter>
    );  
}

export default TopMenu;
